import { Routes,Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import Cart from './pages/Cart'


const App = () => {
  return (
    <div>
      
      <Routes>
        <Route to='/' element={<Navbar/>}/>
        <Route to='/cart' element={<Cart/>}/>
        <Route/>
      </Routes>
    </div>
  );
};

export default App;
